import styled from "styled-components";
import homeimage from "../img/imghomepage.jpg"
import CTA from "./CTA.jsx"

const H1 = styled.h1`
 font-size:14.375em;
 color:#344055;
 margin:0;
 padding-top:10rem;
 .ZE{
        color:white;
    }
`
const H2 = styled.h2`
 font-size:7.25em;
 color:#344055;
 margin-top:-100px;
`
const Homeimg = styled.img`
 z-index:-1;
 right:5rem;
 position:absolute;
 width: 55rem;
 object-fit: cover;
 object-position: top;
 height:55rem;
 border-radius:10px;
 top:7rem;
`
const Slogan = styled.h3`
 font-size:2rem;
 color:#344055;
 font-weight:400;
 .futur{
        color:#358F8B;
        font-weight:bold;
    }
 .simplicite{
    color:#E54B4B;
    font-weight:bold;
    }
`

const Homesection1 = () =>{
    return (
    <Wrapper>
    <Homeimg src={homeimage}></Homeimg>
    <H1>Scooli<span className="ZE">ze</span></H1>
    <H2>Predict</H2>
    <Slogan>Votre <span className="futur">futur</span> en toute <span className="simplicite">simplicité</span></Slogan>
    <CTA className="CTA">Découvrir Les Formations</CTA>
    </Wrapper>
    )
}

const Wrapper = styled.section`
    margin-left:10rem;
    .CTA{
        margin-top:5rem;
    }
`;

export default Homesection1;
